INSERT INTO `sys_wechat_news` VALUES ('455', '为什么ofo投广告，而摩拜却做公关？', 'ww2E5UxkP8-vK-_cBZQKl-27BYM8iFYSiE6VNwgWp7Q', '0', '杰迈科技', '广告已死，公关崛起？', '<p><img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739TQusCtOI0brJN92Aa91TabnU99PQTEHb0GiahgZzFXCcadhRRxcicUGQImCCURUNiajJrraKkicDrGPg/0?wx_fmt=jpeg\" data-ratio=\"0.5689655172413793\" data-w=\"580\"  /><br  /></p><p style=\"text-align: justify;\"><br  /></p><p style=\"text-align: justify; margin-bottom: 10px;\"><span style=\"font-size: 14px;\">2016年8月底，摩拜单车从上海进入北京，终于在媒体的关注下从幕后走向台前。不久，一直潜伏在校园市场的ofo宣布进入“ofo 3.0”时代。这意味着ofo将正式进军城市市场，开始和竞争对手——摩拜展开争夺与厮杀。</span></p><p style=\"text-align: justify; margin-bottom: 10px;\"><span style=\"font-size: 14px;\">膜拜单车和ofo的营销模式又有哪些不同呢？一个靠公关，一个靠广告。如果你用百度指数搜一下以下四个关键词：</span></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \"><span style=\"font-size: 14px;\">1、胡玮炜（摩拜创始人）</span></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \"><span style=\"font-size: 14px;\">2、戴威（ofo创始人）</span></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \"><span style=\"font-size: 14px;\">3、ofo</span></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \"><span style=\"font-size: 14px;\">4、摩拜</span></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \"><span style=\"font-size: 14px;\">你会发现一个非常有趣的现象——在月整体搜索量上，胡玮炜是戴威的6倍多，而ofo是摩拜的3倍多。这是为什么呢？</span></p><p style=\"  ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; margin-top: 10px; \"><span style=\"color: rgb(0, 0, 0);\"><strong><span style=\"font-size: 16px;\">一、CEO的背景</span></strong></span><strong><span style=\"font-size: 16px; color: rgb(0, 0, 0);\"></span></strong></p><p style=\" margin-bottom: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-top: 10px; \"><span style=\"font-size: 14px;\">胡玮炜，双鱼座女子：感性，充满想象力，而且又当了母亲。曾就职于《每日经济新闻》、《新京报》、《商业价值》、极客公园，有着十年的记者生涯。懂得媒体曝光套路，会用情怀和梦想讲故事，她说的那句“失败了，就当做公益吧”到现在还在朋友圈刷屏。所以无论是自身的专业技能，还是人脉圈子，都更偏向于利用媒体做公关、讲故事。在风投界混得久了的人都知道，人们对漂亮的女性创业者充满无限好奇，她们往往自带光芒。</span></p><p style=\" margin-bottom: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-top: 10px; \"><span style=\"font-size: 14px; text-align: justify; text-indent: 0em;\">反观ofo的CEO（戴威），他毕业于北京大学光华管理学院，是个骑行爱好者，媒体给他的评价是：沉稳、温和、儒雅是媒体对他的性格概括，所以就踏踏实实“做产品”、“做创业咯...”。</span></p><p style=\" margin-bottom: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-top: 10px; \"><img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739TQusCtOI0brJN92Aa91Tab8Ebe25rUO4TeXaeicrAYls6Mb09j7QusPATuRXXI0l7GofWd1icOyvXw/0?wx_fmt=jpeg\" data-ratio=\"0.6563636363636364\" data-w=\"550\" style=\" text-indent: 0em ; ; ; ; ; ; ; \"  /></p><p style=\" margin-bottom: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-top: 10px; \"><strong style=\"text-indent: 0em;\"><span style=\"font-size: 16px;\">二、产品&amp;品牌本身的因素</span></strong><br  /></p><p style=\"  ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; margin-top: 10px; \">1.产品的“性能”对比</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">如果你的产品本身就比竞争对手的更受欢迎，那就直接打广告吧！共享单车的出现是为了解决“最后一公里”的交通问题，虽然看似只有“一公里”，但人们普遍更注重它的骑行体验。而ofo就具有这方面的优势，因为它很轻便，摩拜虽然后来也做了很大的改进，但还是没有ofo那么“舒服”。用摩拜的女生比例明显低于ofo，毕竟女生更柔弱娇嫩嘛，当然更喜欢省力的ofo！</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">在APP便捷程度，摩拜还有自己高端大气的APP，下载之后打开定位即可查询周围的小橙车。然后可以预约15分钟，找到车子之后用手机扫码开锁。（确实很吸引人...）</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">ofo在1.0版单车中是“按键式”机械锁，3.0版的单车是“旋转式”机械锁，ofo的对外口径“执拗”地坚信，机械锁的开锁成功率最高，而智能锁单车在偏僻地段如果通讯信号微弱，有可能让单车成为“僵尸”。</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">（1）记住密码、免费蹭车早成为公开的秘密。</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">（2）没有GPS跟踪，无法精准定位维修车辆，还增加了被盗和丢失的机率。</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">（3）缺乏用户短途出行大数据的积累。</p><p><img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739TQusCtOI0brJN92Aa91TabHQqU1YCY0ec1SiaDKOzicbf3k6R1adDEy3TiaFtlYDUKYqcX1rkte2ziaw/0?wx_fmt=jpeg\" data-ratio=\"0.6671875\" data-w=\"640\"  /></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">2.产品的媒体属性<br  /></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">“产品的媒体化”是近些年被无数互联网人挂在嘴边的一句话，从卫龙辣条的苹果风，到江小白的定制瓶，这些产品不再满足于基本的功能需求，而是更具有媒体的属性。</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">最后，在我看来ofo也好，mobike也罢，它们的建立，其实没有那么功利的商业，这才能成就它们开放性的价值，正如豆瓣，知乎。ofo在成立之初是非常共产主义的共享经济，从它们目标群锁定校园即可看出：定位学生，鼓励他们把自己的自行车共享，改装，然后校园内部投放，并给予共享者可以免费使用ofo平台上的任何车辆作为回报。</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">很明显，在这方面，摩拜比ofo做得更好。从摩拜一代的“变态车架”、实心轮胎、GPS定位、自发电、6000元造价、大数据分析，到摩拜Lite的镂空轮胎，这些都是普通自行车不具备的特点，而这种反差性和新奇性就很容易吸引大众的目光，从而引发传播。</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">公关是什么？就是更便宜的广告嘛！只要你说句话，无数媒体和“自媒体”都会跟着你一起说，比如办公室里那些见多识广的小专家们。</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">反观ofo，除了颜色更显眼，和普通自行车比起来，并没有什么明显特征。所以，它的“自传播”属性较弱，必须通过打广告的硬方法。（当然，之前摩拜的推广行动，成功在大众心目中建立了对“共享单车”的认知，也算是为ofo铺了路）</p><p style=\"text-align: justify;\"><span style=\"font-size: 14px;\"></span></p><p><img data-type=\"gif\" data-src=\"http://mmbiz.qpic.cn/mmbiz_gif/XddiavY1739TQusCtOI0brJN92Aa91TabRPeoCpWk7Hdpu0385EtgxicETpK3eIXlQXRrR9wlu2KjbPSH7TAXMBA/0?wx_fmt=gif\" data-ratio=\"0.5603960396039604\" data-w=\"505\"  /></p><p style=\"text-align: justify; text-indent: 0em;\"><span style=\"font-size: 15px;\"></span></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \"><span style=\"font-size: 16px;\">3.品牌的调性与形象</span></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">是不是感觉特有文艺范儿？</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">这不仅仅是照片拍的很文艺，摩拜的整体设计也很有诗意。这种极简设计可以很容易让它与传统自行车区别开来，有一种“享受孤独，体现个性”的感觉。另一方面，做公关有利于让公众对摩拜产生更多的认同和好感。</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">摩拜是第一个成功进入城市市场的共享单车，而ofo更像是跟风，这让摩拜在道德和情感方面更有优势。胡玮炜说的那句“失败了，就当做公益吧”能很好唤起人们对她的支持（谁会反对一个做公益的好人呢？）甚至还有同情。因为除了骑行体验，在很多方面，摩拜与ofo比起来都存在很大的劣势，尤其是成本和因为成本所带来的推广速度慢的问题。</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">不得不说，胡玮炜口中的情怀和梦想，除了是在为自身塑造形象，也是在给公众“戴帽子”：骑摩拜的人更文艺，也更支持公益...</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">至于ofo，由于有“跟风嫌疑”，并且产品和CEO本身的故事性没有那么强，所以直接做产品的功能诉求更为有效。（ps：ofo实际上是比摩拜更早出现的共享单车，只不过它之前一直潜伏在校园市场而已...）</p><p style=\"  ;; font-size: 14px; white-space: normal; text-align: justify; margin-top: 10px; margin-bottom: 10px; \"><strong><span style=\"font-size: 16px;\">三、商业模式</span></strong></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">与ofo相比，摩拜的押金要高得多（99元 vs 299元），如果一辆车可以招来50个用户的话，相当能用6000元的成本“换”50×299≈15000元（第一批生产的摩拜成本也许真有6000元吧）。而这些钱可以马上扔进资本市场，快速运作（翻翻翻）。所以，押金是摩拜非常重要，甚至可能是主要的资产源。在骑行体验不具有优势的情况下，就更应该做好公关工作，否则万一出现“挤兑”现象（金融界术语，意思就是“取款走人”），那真的是肉疼...</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">ofo就无所谓咯，虽然押金低，但骑行体验好（你爱骑不骑），也没那么在乎公关形象，甚至还可以接广告赚钱。</p><p><img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739TQusCtOI0brJN92Aa91TablVewnN13qLicibBOQ2o5km3iaZnqhAeYg2euE3tYLsSZjzpmrl62kP0SQ/0?wx_fmt=jpeg\" data-ratio=\"0.7018181818181818\" data-w=\"550\"  /></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">小结一下，通过ofo和摩拜的营销策略的对比，我们（暂时）可以得出以下结论：</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">1.而如果CEO擅长讲故事，卖情怀，那就去做公关吧，比如马云的创业故事；如果不擅长，那就老老实实做管理、做产品吧。</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">2.如果产品本身没有明显优势的话，可以通过公关，将用户的注意力从产品转移至CEO和企业，类似粉丝经济；如果产品性能的优势很明显，直接投广告也无伤大雅。</p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">3.如果产品本身具有媒体属性，可以选择以公关为主的营销方式，降低营销成本，类似口碑传播；如果没有媒体属性，那就自己努力做广告吧。</p><p style=\"text-align: justify; margin-bottom: 10px;\"><span style=\"  ;; font-size: 14px; \">4.在道德、情感等方面容易获得认同的产品，可以做公关，让公众支持，类似道德绑架；如果没啥好认同的，那就去做功能的诉求，来点实际的。</span></p><p style=\" margin-top: 5px ; ;; font-size: 14px; white-space: normal; text-align: justify; margin-bottom: 10px; \">一言以蔽之：扬长避短！所以，“广告已死，公关崛起”这句话还是过于片面了，还是要根据自身的优劣来进行取舍或组合。</p><p style=\"text-align: justify;\"><span style=\"font-size: 14px;\"></span></p><p><span style=\"font-size: 14px;\"></span></p><p style=\"text-align: justify;\"><span style=\"font-size: 14px;\"></span></p>', 'http://mp.weixin.qq.com/s?__biz=MzI0OTUxMDc5NQ==&mid=100000021&idx=1&sn=dec30b7e9a64680d8c6adf10ff0c72d4&chksm=69912ff15ee6a6e7f60c4e169900d4e9b53f8d80edb8ba9c945a8f6ee7da3ac0761b0811150d#rd', '', 'ww2E5UxkP8-vK-_cBZQKl_WKYJg890TDsFtO5Q92zx8', '0', '100');
INSERT INTO `sys_wechat_news` VALUES ('456', '微信小程序和H5的区别在哪里？', 'ww2E5UxkP8-vK-_cBZQKl9rfY4lhmD_9UYnfO0tNCKg', '0', '', '浅聊微信小程序的价值，与H5的区别与联系.......', '<section class=\"wx96Diy\" data-source=\"bj.96weixin.com\"><p><img class=\"96wx-img\" data-ratio=\"0.20533333333333334\" data-src=\"http://mmbiz.qpic.cn/mmbiz_gif/XddiavY1739Tqk5V3ECkT4dDx0fBZ4bkMFzgWQYXEwWeI8cuiaaeWLtGGy5y4M6sEW3jibxq1k8ic5ibxQtIBibjko2g/0?wx_fmt=gif\" data-type=\"gif\" data-w=\"750\" style=\"width: auto; height: auto;\" width=\"100%\"  /></p></section><section class=\"wx96Diy\" data-source=\"bj.96weixin.com\"><section class=\"96wxDiy\" style=\"margin: 5px auto; padding: 0px; border-width: 0px; border-style: none; border-color: currentcolor; -moz-border-top-colors: none; -moz-border-right-colors: none; -moz-border-bottom-colors: none; -moz-border-left-colors: none; font-size: 14px; white-space: normal;\"><section style=\"padding: 0px; border-width: 0px; border-style: none; border-color: currentcolor; -moz-border-top-colors: none; -moz-border-right-colors: none; -moz-border-bottom-colors: none; -moz-border-left-colors: none;\"><section style=\"margin: 0px; padding: 0px; width: 100%;\"><img class=\"96wx-img\" data-ratio=\"0.8758620689655172\" data-src=\"http://mmbiz.qpic.cn/mmbiz_png/XddiavY1739Tqk5V3ECkT4dDx0fBZ4bkMFM0BkyJ1ssiapKcz3YC34lbvmk8gg0cNRaEQ76I0LmTFKMt2Z7yLdJg/0?wx_fmt=png\" data-type=\"png\" data-w=\"145\" style=\"width: 90px; height: 90px; color: inherit;\"  /><section class=\"96wx-bdc\" style=\"border-style: dashed; border-color: rgb(61, 167, 66); margin: -60px 0px 10px 30px; padding: 22px; border-radius: 20px; color: inherit;\"><p style=\"color: inherit; line-height: 30px; text-indent: 2em; font-size: 14px;\"><span style=\"padding: 0px; border-width: 0px; border-style: none; border-color: currentcolor; -moz-border-top-colors: none; -moz-border-right-colors: none; -moz-border-bottom-colors: none; -moz-border-left-colors: none; color: inherit;\">&nbsp;&nbsp;&nbsp;&nbsp; 微信小程序是微信基于H5技术的基础上开发的一种公众号类型，颇受业界关注。那么有的人就会问了，微信小程序与H5都是基于H5技术研发出来的，它们之间到底有什么不同?</span> </p></section></section></section></section></section><p><strong><br  /></strong></p><section class=\"wx96Diy cur\" data-source=\"bj.96weixin.com\"><section class=\"96wxDiy\" style=\"margin: 5px auto; padding: 0px; border-width: 0px; border-style: none; border-color: currentcolor; -moz-border-top-colors: none; -moz-border-right-colors: none; -moz-border-bottom-colors: none; -moz-border-left-colors: none; font-size: 14px; white-space: normal;\"><section style=\"margin-top: 10px; margin-bottom: 10px;\"><section class=\"96wx-bgc\" style=\"width: 12px; height: 12px; color: rgb(255, 255, 255); float: left; background-color: rgb(61, 167, 66);\"></section><section class=\"96wx-bgc\" style=\"width: 12px; height: 12px; color: rgb(255, 255, 255); float: right; background-color: rgb(61, 167, 66);\"></section><section style=\"clear: both;\"></section><section style=\"margin: -5px; padding-right: 10px; padding-left: 10px;\"><section class=\"96wxDiy\" style=\"padding: 10px; border-width: 2px; border-style: dotted; border-color: rgb(193, 193, 193); -moz-border-top-colors: none; -moz-border-right-colors: none; -moz-border-bottom-colors: none; -moz-border-left-colors: none; line-height: 30px; text-indent: 2em;\"><p><span style=\"font-size: 16px;\"><strong>一、运行环境的不同</strong></span></p><p>&nbsp;传统的HTML5的运行环境是浏览器，包括webview，而微信小程序的运行环境并非完整的浏览器，大家注意，我这里写的是“非完整的浏览器”，有以下几个原因：</p><p>小程序的开发过程中会用到HTML5相关的技术(并非全部)，小程序最后的发布上线需要微信审核，微信在不更新自身软件的情况下可以将小程序更新到自身软件内，这就联想到了React\n \nNative框架,并且已经有开发者在微信小程序的开发工具源码中发现使用了React和NodeWebkit库，官方文档中着重强调了脚本内是无法使用浏览器中常用的window对象和document对象(基于这一点，像zepto/jquery这种操作dom的库就被完全抛弃了)。</p><p>所以我个人认为，小程序的运行环境很有可能是微信开发团队基于浏览器内核完全重构的一个内置解析器，针对小程序专门做了优化，配合自己定义的开发语言标准，提升了小程序的性能。</p><p>不过由于微信给开发者提供了开发工具，而开发工具中也内置了编程、调试、开发环境、发布于一身，我们也不用再探讨它的最终运行环境了，只要按照官方文档进行开发就可以了。并且从微信团队给开发者提供开发工具这一举动，让我联想到了苹果给开发者提供的X-CODE开发工具，可以想象微信的“野心”可见一般。<img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739Tqk5V3ECkT4dDx0fBZ4bkMAKUeO7fEOXSNuSibmJum42VyIbtYIlRWkTLwNibOZNby6IrjKc0mhbmw/0?wx_fmt=jpeg\" data-ratio=\"1\" data-w=\"400\"  /></p><p><span style=\"font-size: 16px;\"><strong>二、开发成本的不同</strong></span></p><p style=\"text-indent: 2em;\">这里我提出了一个问题，当我们面对一个HTML5 \nweb开发需求时，我们需要考虑什么呢?抛去开发工具(vscode、sublimtext、Atom等)不谈，大到前端框架(Angular、react、vue、backbone等)、模块管理工具(Webpack\n 、Browserify 等)、任务管理工具(Grunt、Gulp等)，小到UI库选择、接口调用工具(ajax、Fetch \nApi等)、浏览器兼容性等都要我们一一考略，再不济用jqery插件写H5，也要在开发过程中去寻找合适的jquery插件来配合项目。</p><p style=\"text-indent: 2em;\">尽管这些工具可定制化非常高，并且提高了开发者的开发效率，但我相信项目开发的配置工作已经消耗了不少精力，尽管大部分开发者都有自己的配置模板，但长久以来对于项目中使用的各种外部库的版本迭代、版本升级所产生的成本应该也不低。</p><p style=\"text-indent: 2em;\">而当我们面对一个微信小程序的开发需求时，我们需要考虑什么呢?微信团队提供了开发者工具，并且规范了开发标准，前端常见的HTML、CSS变成了微信自定义的WXML、WXSS，WXML中尽管全部是自定义标签，但官方文档中都有明确的使用介绍，相信上手应该是非常容易的;WXSS、JSON和JS文件中的写法稍有限制，但整体相差不多。</p><p style=\"text-indent: 2em;\">在统一了这些标准之后，作为一个开发者，你会发现，自己只要专注写程序就可以了：</p><ol style=\"list-style-type: decimal;\" class=\" list-paddingleft-2\"><li><p style=\"text-indent: 0em;\">当需要调用后端接口时，调用发起请求API</p></li><li><p style=\"text-indent: 0em;\">当需要上传下载时，调用上传下载API</p></li><li><p style=\"text-indent: 0em;\">当需要数据缓存时，调用本地存储API</p></li><li><p style=\"text-indent: 0em;\">引入地图、使用罗盘、调用支付、调用扫码等等功能都可以直接使用</p></li><li><p style=\"text-indent: 0em;\">UI库方面，框架自然带有自家weui库加成</p></li><li><p style=\"text-indent: 0em;\">并且在使用这些API时，你不用再去顾虑浏览器兼容性，不用担心生产环境中出现不可预料的奇妙BUG，可见微信小程序的开发成本确实相比以往的web开发低很多。</p></li></ol><p><span style=\"font-size: 16px;\"><strong>三、获取系统权限的不同</strong></span></p><p style=\"text-indent: 2em;\">微信小程序相对于HTML5 \nweb应用能获得更多的系统权限，比如网络通信状态、数据缓存能力等，这些系统级权限都可以和微信小程序无缝衔接，也就是官方宣称的拥有Native \nApp的流畅性能，而这一点恰巧是HTML5 web应用经常被诟病的地方，这也是HTML5的大多应用场景被定位在业务逻辑简单、功能单一的原因。</p><p style=\"text-indent: 2em;\"><span style=\"font-size: 16px;\"><strong>四、应用在生产环境的运行流畅度不同</strong></span></p><p style=\"text-indent: 2em;\">这条无论对于用户还是开发者来说，都是最直观的感受。长久以来，当HTML5应用面对复杂的业务逻辑或者丰富的页面交互时，它的体验总是不尽人意，需要不断的对项目优化来提升用户体验。</p><p>但是由于微信小程序运行环境独立，尽管同样用html+css+js去开发，但配合微信的解析器最终渲染出来的是原生组件的效果，自然体验上将会更进一步。<img data-s=\"300,640\" data-type=\"jpeg\" data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739Tqk5V3ECkT4dDx0fBZ4bkMAgNibcR83LibumkjTiaic57QR4hd5Cibp1MoPjx5jGWN20Qvqqnamo8ic7Zw/0?wx_fmt=jpeg\" data-ratio=\"0.94375\" data-w=\"320\"  /></p><p><span style=\"font-size: 16px;\"><strong>五、总结</strong></span></p><p style=\"text-indent: 2em;\">那么，微信小程序会成功还是失败呢？没人可以在如期早期做这样的判断，前几周，星巴克和微信卡劵合作推出线上购买咖啡劵送给好友的活动，特点是用户可以将咖啡劵定制成虚拟心意卡，这个例子不用微信小程序做也可以，为什么非要扯到小程序呢？只用一个HTML页面也可以完成。我想说的是，微信给我们连接线下提供了很好能力，但微信不是唯一提供这个能力的厂商。但它可能是目前最好的，也是用户基数最大的，最容易让我们起步去连接未被连接流量的。<br  /></p><p style=\"text-indent: 2em;\">张小龙做小程序的出发点是为了更好的用户体验，而企业做小程序的出发点是为了自身的利益。如果企业不能从小程序中找到实现价值的商业模式，谁会为小程序买单呢？<br  /></p><p style=\"text-indent: 2em;\">我更愿意从另一个角度去理解，小程序给我们更多的启发是，场景化的流量有太多太多没被用上，创业者应该去思考如何利用这些流量，提供伴随式的快连接服务，并且利用中国最大的连接工具 — 微信，把一切闲置的流量连接起来。这可能，才是真正的 O2O。</p><p style=\"text-indent: 2em;\"><span style=\"font-size: 14px;\">总的来说，微信小程序与H5相比，无论在开发成本或是用户体验上拥有更大的优势，会给用户一个全新的平台体验。</span></p><p>&nbsp;<br  /></p></section></section><section class=\"96wx-bgc\" style=\"width: 12px; height: 12px; color: rgb(255, 255, 255); float: left; background-color: rgb(61, 167, 66);\"></section><section class=\"96wx-bgc\" style=\"width: 12px; height: 12px; color: rgb(255, 255, 255); float: right; background-color: rgb(61, 167, 66);\"><img class=\"96wx-img\" data-ratio=\"0.19076923076923077\" data-src=\"http://mmbiz.qpic.cn/mmbiz_gif/XddiavY1739Tqk5V3ECkT4dDx0fBZ4bkMHRNLVEnvqfrLl6uuHHYkNicoyIbl9RCH5VibAa31XXVrMM7yzj7wiaTibw/0?wx_fmt=gif\" data-type=\"gif\" data-w=\"650\"  /></section></section></section></section>', 'http://mp.weixin.qq.com/s?__biz=MzI0OTUxMDc5NQ==&mid=100000010&idx=1&sn=a104813dc2e10906d913e17710d68f41&chksm=69912fee5ee6a6f8f3e649f21fcc978d4df83ec991923b0c7a25cc6274ee27a5fb3fd07fd054#rd', '', 'ww2E5UxkP8-vK-_cBZQKl6ScoOPgBQM5IRIkPy3UKtw', '0', '101');
INSERT INTO `sys_wechat_news` VALUES ('457', '涨姿势：开发一个App需要多少钱？', 'HNq8VNjSMl_T-9W16i6K9zjr7ETxfyhIYO-qlQquK5Q', '0', '杰迈科技', '如果你是互联网行业的，尤其是做产品或开发工作，总会遇到有人问你这样一个问题：开发一个App多少钱？因为在自己', '<p><br  /></p><p><br  /></p><article style=\"\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739Tusl0JeA1bPdOp0gtWvbUaPU1X065rIMUf4EUbdGlzEL7jUk3Lmvuxywb5BTCtybMd9eUdzn8zcw/0?wx_fmt=jpeg\" style=\"border-width: 1px 0px; border-top-style: solid; border-bottom-style: solid; border-top-color: rgb(236, 236, 236); border-bottom-color: rgb(236, 236, 236); display: block; width: 441px;\" class=\"\" data-type=\"jpeg\" data-ratio=\"0.5596026490066225\" data-w=\"604\"  /></article><p><br  /></p><p><br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">如果你是互联网行业的，尤其是做产品或开发工作，总会遇到有人问你这样一个问题：开发一个App多少钱？</p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">因为在自己的知识和能力覆盖范围之内，所以遇到这样的问题,我会耐心的问为什么要做App, 这个app给什么样的人使用，实现什么样的功能，满足什么样的需求，预估初期有多少用户，要开发安卓还是ios等等。<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">但是慢慢我发现这样问很多人会不耐烦，有的人觉得这涉及到他们的商业机密闪烁其辞，即使都问了一遍，最后的关注点，还是在让你能给出一个固定的费用，并不注重前面的分析，等于问了一大堆问题都是白问，浪费了彼此的时间。<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">为什么要问这些问题，一个是为了了解开发App背后的目的和用户的需求，方便给出准确的建议，在没有明确需求的情况下，不管是谁都无法估计出一个App多少钱，另外一个是要让提问的人知道，开发一个app的费用并非只有一个影响因素，还有其它很多因素要考虑。很多产品也没有必要开发App，为什么现在很多人说起互联网产品，就只知道App呢？虽然现在开发一个App并非难事，但也不是那么简单，在回答开发一个App需要多少钱之前先说说下面的这些问题。<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">一. App的构成<br  /></p><p style=\" color: rgb(76, 76, 76); ; ; ; ; ; ; ; \"><br  /></p><p><br  /></p><p><br  /></p><article style=\"\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739Tusl0JeA1bPdOp0gtWvbUavJa5PiagDc3z5UicEV7YQuTplphpJusmEEBlZzNIiayD9O6kTib8Wb8Hjg/0?wx_fmt=jpeg\" style=\"border-width: 1px 0px; border-top-style: solid; border-bottom-style: solid; border-top-color: rgb(236, 236, 236); border-bottom-color: rgb(236, 236, 236); display: block; width: 441px;\" class=\"\" data-type=\"jpeg\" data-ratio=\"0.36258278145695366\" data-w=\"604\"  /></article><p><br  /></p><p><br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">首先我们来看看App的构成，一般一个完整的App产品包含服务端和客户端两个部分（如上图所示），没有服务端的App也有，像简单的工具类，单机游戏，但是非常少，从经营的角度考虑，为了积累用户和数据，大部分App都有服务端；客户端就是平常我们从应用商店下载到手机上的部分, 服务端一般提供数据读写存储，处理业务逻辑，进行图片，视频等资源存储，部署在服务器上，用户使用客户端通过接口和服务端进行交互，享受App提供的服务。<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">客户端用户更能容易感知（大部分用户所理解的App，也就是客户端），实际上,服务端才是App中最重要的部分，从代码量上来说，一般一个客户端容量大小在几兆到上百兆不等，但是服务端往往会非常庞大，比如我之前工作的公司，每次更新代码量都在好几G，这还不是全部，所以在整个App产品中，客户端只是“小荷才漏肩尖尖角”中的尖尖角，大头是服务端。<br  /></p><p style=\" color: rgb(76, 76, 76); ; ; ; ; ; ; ; \"><br  /></p><p><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739Tusl0JeA1bPdOp0gtWvbUagBCBhmD9icPyj3WvicTRlKgiatnwhyPQZeBILnnQu45JmqtD6C0fy06aw/0?wx_fmt=jpeg\" class=\"\" data-type=\"jpeg\" data-ratio=\"0.4798657718120805\" data-w=\"596\" style=\"line-height: 1.6; border-width: 1px 0px; border-top-style: solid; border-bottom-style: solid; border-top-color: rgb(236, 236, 236); border-bottom-color: rgb(236, 236, 236); display: block; width: 441px;\"  /></p><p><br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">客户端需要根据手机操作系统来开发，不同的操作系统，有不同的要求，对于开发者来说，只需要满足主流的的操作系统即可，目前用的最多的操作系统分别为（如上图所示）苹果的iOS系统,谷歌的Android系统和微软的Windows Phone(简称为WP)，目前iOS系统和Android系统占据了大部分市场，WP的用户量非常小，如果人力和物力有限，只需开发iOS版和Android版本即可，没有必要全部开发，如果是为了测试市场，根据目标群体使用手机的特征，在iOS版和Android版中任选一个开发即可，要不然会造成资源浪费，总的来说，一个App构成如下图所示：<br  /></p><p style=\" color: rgb(76, 76, 76); ; ; ; ; ; ; ; \"><br  /></p><p><br  /></p><article style=\"\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739Tusl0JeA1bPdOp0gtWvbUad7mPicpx4btPd6KchESicT7ic8KvTNIzLpj33k8B5JJwk9Q8Ie2icMHGXw/0?wx_fmt=jpeg\" style=\"border-width: 1px 0px; border-top-style: solid; border-bottom-style: solid; border-top-color: rgb(236, 236, 236); border-bottom-color: rgb(236, 236, 236); display: block; width: 441px;\" class=\"\" data-type=\"jpeg\" data-ratio=\"0.44039735099337746\" data-w=\"604\"  /></article><p><br  /></p><p><br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">二. 开发一个App需要的人员配置<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">开发App最大的开销是人力成本，在一个完整的产品团队中，一般需要包含如下角色成员：<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">项目经理 产品经理 UI设计师 ios开发工程师 Android开发工程师 服务端开发工程师 测试工程师 运维工程师 根据项目的大小，公司财力和项目的紧急程度，这些人员的数量配置会不等。<br  /></p><p style=\" color: rgb(76, 76, 76); ; ; ; ; ; ; ; \"><br  /></p><p><br  /></p><article style=\"\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739Tusl0JeA1bPdOp0gtWvbUa2HtdlLynax5zBL5LAwoAvicvEOOiclcJcsx4ymGgFxaxY2PwEzjHrSeQ/0?wx_fmt=jpeg\" style=\"border-width: 1px 0px; border-top-style: solid; border-bottom-style: solid; border-top-color: rgb(236, 236, 236); border-bottom-color: rgb(236, 236, 236); display: block; width: 441px;\" class=\"\" data-type=\"jpeg\" data-ratio=\"0.5719489981785064\" data-w=\"549\"  /></article><p><br  /></p><p><br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">一个小的项目组，项目经理一般只需要一个，设计师和测试工程师在初期一个也可以满足，不够用的时候可以增加实习生，产品经理和工程师大概比例在1:4。<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">不论是处于创业期的团队还是大公司，开发资源永远都是稀缺的，很多都达不到满意的配置，在资源有限的情况下人员配置还可以压缩如下：<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">产品经理 ios开发工程师 Android开发工程师 服务端开发工程师 项目经理由服务端开发工程师或产品经理担任,产品经理负责产品需求梳理,产品设计,文案等工作,UI设计部分如果产品经理不能设计，外包解决，ios和Android开发各一个，服务端工程师负责开发和运维，测试大家一起测，这样一个最小的四人团队就组成了。在这里面对产品经理和服务端开发工程师的能力要求都比较高，需要全栈型人才。两个人或者一个人也可以开发App, 但是这样的人凤毛麟角，也很难持续。<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">三. 开发一个App需要多长时间？<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">在评估时间之前，我们先将开发过程拆分为以下6个部分：<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">(1)需求梳理<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">(2)产品设计及评审<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">(3)UI设计及评审<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">(4)开发任务分解和排期<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">(5)开发与联调<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">(6)测试并修改bug<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">每个环节的使用的时间加起来就是一个App大概的开发时间。<br  /></p><p style=\" color: rgb(76, 76, 76); ; ; ; ; ; ; ; \"><br  /></p><p><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739Tusl0JeA1bPdOp0gtWvbUapuXhKvu1BPtiaAMBOP6b6IkeV1YxzhcIlInbRB21pibZ3HQUiawkZp5sw/0?wx_fmt=jpeg\" class=\"\" data-type=\"jpeg\" data-ratio=\"0.7152317880794702\" data-w=\"604\" style=\"line-height: 1.6; border-width: 1px 0px; border-top-style: solid; border-bottom-style: solid; border-top-color: rgb(236, 236, 236); border-bottom-color: rgb(236, 236, 236); display: block; width: 441px;\"  /></p><p><br  /></p><p style=\" color: rgb(76, 76, 76); ; ; ; ; ; ; \">在上面每个环节里面，一部分时间会花在沟通上，另一部分会花在执行实施上 ，沟通时间包括需求讨论，评审，会议，以及等待确认的时间，执行实施时间就是干活的时间。在这里面很多人都容易忽略沟通的时间成本，尤其是和甲方合作的项目，沟通成本会非常大，而这部分成本甲方是最不理解的, 大多数时候，沟通的时间比执行的时间要大很多,所以在评估时间的时候，千万千万不要忘记这部分时间。</p><p style=\" color: rgb(76, 76, 76); ; ; ; ; ; ; ; \"><br  /></p><p><br  /></p><article style=\"\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739Tusl0JeA1bPdOp0gtWvbUaaAyhrb5lLWZTCdEoRSASMyy2cvEhVEYVJcRmK7DEJu7TpNIfrGCLHQ/0?wx_fmt=jpeg\" style=\"border-width: 1px 0px; border-top-style: solid; border-bottom-style: solid; border-top-color: rgb(236, 236, 236); border-bottom-color: rgb(236, 236, 236); display: block; width: 441px;\" class=\"\" data-type=\"jpeg\" data-ratio=\"0.6374172185430463\" data-w=\"604\"  /></article><p><br  /></p><p><br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">作为产品的owner，往往希望产品提前或者按期上线，但是人生不如意事十有八九，很多时间即使有排期，也因为一些突发事件导致项目延期，所以在评估时间的时候，一定要想到项目延期的情况。导致延期的情况各种各样，但有两个比较严重：<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">一个是需求方需求不明确，经常变更需求。比如开发了一半了，突然要加功能或修改功能 , 这种情况在新人和对互联网不了解的人身上经常发生 ; 另一个是研发中没有对过程进行干预，比如按照排期10天后产品上线，产品设计完成后交给研发，10天后到了上线时间，问研发的小伙伴，发现才做了一半，一问原因，是因为中间有人请假，这是好点的情况，如果是找外包的开发，有可能一点都没有做，这不仅浪费了资金，也白白浪费了时间，所以在需求阶段，一定要把需求描述清楚，排好优先级，在开发阶段，要做到过程干预和风险控制，要不然就等着延期吧！<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">四. 开发一个App需要多少钱？<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">谈钱不伤感情，终于要谈到正题了，前面已经介绍了App的构成，人员配置和时间预估，开发一个App的费用成本主要在于开发人员配置和开发的时间（工作量），那么我们用一个20个页面，包含50个常规功能，需要同时开发ios和安卓客户端的产品为例来说说需要多少费用：<br  /></p><p style=\" color: rgb(76, 76, 76); ; ; ; ; ; ; ; \"><br  /></p><p><br  /></p><article style=\"\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz_jpg/XddiavY1739Tusl0JeA1bPdOp0gtWvbUay8VUS2DI1MYFSBibO8TbXONxjxLmicH6cQhlRia4MpBicpu0gfGdHbCTJQ/0?wx_fmt=jpeg\" style=\"border-width: 1px 0px; border-top-style: solid; border-bottom-style: solid; border-top-color: rgb(236, 236, 236); border-bottom-color: rgb(236, 236, 236); display: block; width: 441px;\" class=\"\" data-type=\"jpeg\" data-ratio=\"0.6224489795918368\" data-w=\"490\"  /></article><p><br  /></p><p><br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">人员配置：<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">产品经理1枚<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">UI设计师1枚<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">服务端开发工程师1枚<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">安卓开发工程师1枚<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">ios开发工程师1枚<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">时间预估：<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">需求梳理：7天，输出物为包含功能点，功能描述及优先级排序的需求文档<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">产品设计：10天，输出物为流程图，产品原型和产品需求文档<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">UI设计：7天，输出物为UI设计图<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">开发任务分解及排期：1天，输出物为甘特图<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">开发：60天，包含客户端和服务端开发，客户端和服务端联调（客户端按照每天一个页面计算，服务端按每天一个功能点计算，因为客户端和服务端时间有重合端部分，所以算了60天）<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">测试并修改bug：10天，输出物为最后可上线运行的产品<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">开始计算了：<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">假如工作地点在北京，每个人的平均成本按1000元／天来计算（包含办公和社保等成本）<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">最后预估总时间为：7+10＋7+1+60+10＝95天<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">费用大概是5*1000*95 =475000元<br  /></p><p class=\"duanluo\" style=\" padding-top: 16px; text-align: justify; word-break: break-all; color: rgb(76, 76, 76); ; ; ; ; ; ; \">上面说的是评估费用的大概思路, 在具体实施的时候，同一个项目，不同的目标，不同的执行人来操作最后的时间差别会很大。比如在产品设计环节，领导发话说就照着某个产品来抄吧，那么产品和设计部分工作量会减少，在开发环节，如果用开源的框架或者开发者之前开发过类似的产品, 那么开发的时间也会大大缩短，如果采用敏捷开发的方式，时间预估按小时预估会更准确，设计师在完成UI设计后, 后面的不参与的部分可以不算工作量，开发团队放在成都，西安等地方，成本也会降下来，如果团队里面有大牛级别人物，成本也会增加，以上只是一个思路让大家知道怎么去评估开发一个App需要多少费用，遇到具体的问题，还需要具体分析。<br  /></p><p><br  /></p>', 'http://mp.weixin.qq.com/s?__biz=MzI0OTUxMDc5NQ==&mid=100000007&idx=1&sn=7644043aaa5b2cae6b1db78b5ac9dd98&chksm=69912fe35ee6a6f53b4e4cb6e4d22ba3eeb4c4ce7ca003212f0db6bf6498eca1dd7b750ff85c#rd', '', 'ww2E5UxkP8-vK-_cBZQKl-UgNCef4zlejfdheC0iTlM', '0', '102');
INSERT INTO `sys_wechat_news` VALUES ('458', '这tm就是设计师不想改图的真正原因！', 'ww2E5UxkP8-vK-_cBZQKly8I6FsNUPwL03QuKvvS5JY', '0', '', '突然间觉得有食欲了。需求总是一次次被创造，而设计一次次被轮爆......', '<p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><strong style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><img data-src=\"http://mmbiz.qpic.cn/mmbiz/XddiavY1739QAIVvgcAH1NF3ePNnU5ibb8X6QC7qqdrdUiaciaW5Had8vADVXTLxQ2pB6xC6qXzb8Ykxv1Ua7kO1TA/0?wx_fmt=gif\" class=\"\" data-type=\"gif\" data-ratio=\"0.25\" data-w=\"400\"  /></span></strong></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><strong style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><br  /></span></strong></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><strong style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\">你去饭店，坐下来。</span></strong></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /></span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; color: rgb(217, 33, 66); box-sizing: border-box !important; word-wrap: break-word !important;\">你</span><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\">：服务员，给我来份宫保鸡丁！<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  />服务员：好嘞！</span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; color: rgb(61, 170, 214); box-sizing: border-box !important; word-wrap: break-word !important;\">☝这叫原始需求<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /></span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><strong style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /></strong></span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><strong style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">大厨做到一半</strong></span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /></span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"max-width: 100%; color: rgb(217, 33, 66); box-sizing: border-box !important; word-wrap: break-word !important;\">你</span><span style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"></span>：服务员，菜里不要放肉。<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  />服务员：不放肉怎么做啊？<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><span style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"max-width: 100%; color: rgb(217, 33, 66); box-sizing: border-box !important; word-wrap: break-word !important;\">你</span>：</span>不放肉就行了，其它按正常程序做，不就行了，难吗？<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><span style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">服务员：</span>好的，您稍等。<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><span style=\"max-width: 100%; color: rgb(61, 170, 214); box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">☝</span>中途需求变更</span><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /></span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><strong style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><img data-w=\"400\" data-ratio=\"0.5525\" data-type=\"gif\" data-src=\"http://mmbiz.qpic.cn/mmbiz/sib4GrK0lPemoictw3LURJRcdWoxoAyTdmuSN30vibvO7BLGj7CNaww3ibicOibKrY9VgY2YXgpB2xDDr5jhIpgH2ZQA/0?wx_fmt=gif\" width=\"400px\" style=\"box-sizing: border-box !important; word-wrap: break-word !important; width: 400px !important; visibility: visible !important;\"  /><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /></strong></span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><strong style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /></strong></span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><strong style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">厨房</strong></span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><span style=\"max-width: 100%; color: rgb(216, 79, 169); box-sizing: border-box !important; word-wrap: break-word !important;\">大厨</span>：你大爷，我肉都回锅了<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  />服务员：顾客非要要求的嘛，你把肉挑出来不就行了吗<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><span style=\"max-width: 100%; color: rgb(216, 79, 169); box-sizing: border-box !important; word-wrap: break-word !important;\">大厨</span>：行你大爷<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  />然而还是一点点挑出来了<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><span style=\"max-width: 100%; color: rgb(61, 170, 214); box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">☝</span>改动太大，部分重构</span><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><strong style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">餐厅</strong></span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /></span></p><p style=\" max-width: 100%; min-height: 1em; color: rgb(62, 62, 62) ; ; ; ; ; ; ; ; ; \"><span style=\"max-width: 100%; font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"max-width: 100%; color: rgb(217, 33, 66); box-sizing: border-box !important; word-wrap: break-word !important;\">你</span>：服务员，菜里能给我加点腐竹吗？<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><span style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">服务员：</span>行，这个应该简单。<br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><span style=\"max-width: 100%; color: rgb(61, 170, 214); box-sizing: border-box !important; word-wrap: break-word !important;\"><span style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\">☝</span>低估改动成本</span><br style=\"max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;\"  /><br style=\"max-